import React from "react";
import Geral from "../Geral";

export default function Departamentos(){
    return(
        <Geral>
            <h1>Departamentos</h1><ul>
                    <li>Administração</li>
                    <li>Biologia</li>
                    <li>Computação</li>
                    <li>Direito</li>
                    <li>Engenharia</li>
                </ul>
        </Geral>
    )
}
